local function getGenericClsFrom(name)
  local _, i = name:find('.*`')
  if i then
    local genericBaseName = name:sub(1, i - 1)
    local genericArgumentCount = name:sub(i + 1, i + 1)
    name = genericBaseName .. '_' .. genericArgumentCount
  end
  return getClass(name)
