      this.Units = ListSpawnedUnit()
      this.PlayerId = GetPlayerId(wc3Player)
      this.Wc3Player = wc3Player
    end







    CreateUnit = function (this, unitTypeId, area, face)
      local unit = SourceModels.SpawnedUnit(this, unitTypeId, area, face)
      this.Units:Add(unit)
      return unit
    end



